DROP TABLE IF EXISTS `perfiles`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `perfiles` (
  `Id` int(6) NOT NULL AUTO_INCREMENT COMMENT 'ID del perfil',
  `Id_hotspot` int(6) DEFAULT NULL COMMENT 'ID del Hotspot al que pertenece',
  `ServerName` varchar(20) NOT NULL COMMENT 'Nombre de Hotspot Server',
  `Descripcion` varchar(30) NOT NULL COMMENT 'Descripcin del perfil. En caso de Paypal prefijo PP',
  `Duracion` int(10) NOT NULL DEFAULT '1800' COMMENT 'Duracin de la conexin',
  `Movilidad` varchar(20) NOT NULL DEFAULT 'Called-Station-Id' COMMENT 'Tipo de movilidad',
  `ModoConsumo` varchar(20) NOT NULL DEFAULT 'Continuo' COMMENT 'Modo de computo del tiempo',
  `Acct-Interim-Interval` int(4) NOT NULL DEFAULT '600' COMMENT 'Tiempo de accounting',
  `Idle-Timeout` int(4) DEFAULT NULL COMMENT 'Tiempo de desconexin',
  `Simultaneous-Use` int(4) DEFAULT NULL COMMENT 'Usos simultaneos',
  `Login-Time` varchar(20) DEFAULT NULL COMMENT 'Tramo horario o fecha especifica de uso',
  `Expiration` date DEFAULT NULL COMMENT 'Fecha y hora de expiracin',
  `WISPr-Bandwidth-Max-Down` int(20) DEFAULT NULL COMMENT 'Velocidad mxima de descarga',
  `WISPr-Bandwidth-Max-Up` int(20) DEFAULT NULL COMMENT 'Velocidad mxima de subida',
  `TraficoDescarga` int(20) DEFAULT NULL COMMENT 'Trfico en MB ',
  `userformat` varchar(20) DEFAULT NULL,
  `Password` tinytext COMMENT 'Establece contrasea predeterminada',
  PRIMARY KEY (`Id`)
) ENGINE=MyISAM AUTO_INCREMENT=90 DEFAULT CHARSET=utf8;
